var __index = {"config":{"lang":["zh","en"],"separator":"[\\s\\u200b\\-_,:!=\\[\\]()\"`/]+|\\.(?!\\d)|&[lg]t;|(?!\\b)(?=[A-Z][a-z])","pipeline":["stemmer"]},"docs":[{"location":"index.html","title":"Fucking Code","text":"<p>Everything about the fucking code.</p>"},{"location":"CONTRIBUTING.html","title":"\u8d21\u732e\u6307\u5357","text":"<p>First off, thanks for taking the time to contribute! \u2764\ufe0f \u9996\u5148\uff0c\u611f\u8c22\u60a8\u62bd\u51fa\u5b9d\u8d35\u65f6\u95f4\u505a\u51fa\u8d21\u732e\uff01\u2764\ufe0f</p> <p>All types of contributions are encouraged and valued.Please see the table of contents right for details on the different ways to contribute and how to handle them. Be sure to read the relevant section before contributing, this will make it easier for our maintainers and make the experience smoother for everyone involved. We look forward to your contributions! \u6240\u6709\u7c7b\u578b\u7684\u8d21\u732e\u90fd\u662f\u503c\u5f97\u9f13\u52b1\u548c\u91cd\u89c6\u7684\u3002\u8bf7\u53c2\u9605\u53f3\u4fa7\u7684\u76ee\u5f55\uff0c\u4e86\u89e3\u4e0d\u540c\u7684\u8d21\u732e\u65b9\u5f0f\u53ca\u5982\u4f55\u5904\u7406\u5b83\u4eec\u7684\u8be6\u7ec6\u4fe1\u606f\u3002\u8bf7\u52a1\u5fc5\u5728\u8d21\u732e\u524d\u9605\u8bfb\u76f8\u5173\u90e8\u5206\uff0c\u8fd9\u5c06\u4f7f\u6211\u4eec\u7684\u7ef4\u62a4\u4eba\u5458\u66f4\u5bb9\u6613\uff0c\u5e76\u4f7f\u6240\u6709\u76f8\u5173\u4eba\u5458\u7684\u4f53\u9a8c\u66f4\u52a0\u987a\u7545\u3002\u6211\u4eec\u671f\u5f85\u60a8\u7684\u8d21\u732e\uff01</p> <p>If you like - \u5982\u679c\u4f60\u559c\u6b22</p> <p>And if you like the project, but just don't have time to contribute, that's fine. There are other easy ways to support the project and show your gratitude, and we are also very happy, such as star the project! \u2b50 \u5982\u679c\u4f60\u559c\u6b22\u8fd9\u4e2a\u9879\u76ee\uff0c\u4f46\u53ea\u662f\u6ca1\u6709\u65f6\u95f4\u505a\u51fa\u8d21\u732e\uff0c\u90a3\u4e5f\u6ca1\u5173\u7cfb\u3002\u8fd8\u6709\u5176\u4ed6\u7b80\u5355\u7684\u65b9\u6cd5\u53ef\u4ee5\u652f\u6301\u8be5\u9879\u76ee\u5e76\u8868\u8fbe\u60a8\u7684\u611f\u6fc0\u4e4b\u60c5\uff0c\u6211\u4eec\u4e5f\u975e\u5e38\u9ad8\u5174\uff0c\u4f8b\u5982\u7ed9\u8fd9\u4e2a\u9879\u76ee\u52a0\u661f\u6807\uff01\u2b50</p>"},{"location":"CONTRIBUTING.html#i-have-a-question-","title":"I Have a Question - \u6709\u95ee\u9898","text":""},{"location":"CONTRIBUTING.html#issue-","title":"Issue - \u95ee\u9898","text":"<p>If you want to ask a question, we assume that you have read the available Documentation.If you still don't find an answer you're happy with, you can start an issue and we'll get back to you as quickly as possible. \u5982\u679c\u60a8\u60f3\u63d0\u51fa\u95ee\u9898\uff0c\u6211\u4eec\u5047\u8bbe\u60a8\u5df2\u7ecf\u9605\u8bfb\u4e86\u53ef\u7528\u7684\u6587\u6863\u3002\u5982\u679c\u4ecd\u7136\u6ca1\u6709\u627e\u5230\u60a8\u6ee1\u610f\u7684\u7b54\u6848\uff0c\u60a8\u53ef\u4ee5\u53d1\u8d77\u4e00\u4e2a issue\uff0c\u6211\u4eec\u5c06\u5c3d\u53ef\u80fd\u5feb\u5730\u7ed9\u51fa\u7b54\u590d\u3002</p>"},{"location":"CONTRIBUTING.html#discussion-","title":"Discussion - \u8ba8\u8bba","text":"<p>If you have any suggestions, etc., you can start a discussion in the discussion board. For example, you can start a discussion about a feature, discuss it with someone else or a project maintainer, and we will make improvements to the project based on the results of the discussion, or we may not take the suggestion. \u5982\u679c\u4f60\u6709\u4ec0\u4e48\u5efa\u8bae\u7b49\uff0c\u4f60\u53ef\u4ee5\u5728\u8ba8\u8bba\u533a\u53d1\u8d77\u4e00\u4e2a\u8ba8\u8bba\u3002\u6bd4\u5982\u4f60\u53ef\u4ee5\u53d1\u8d77\u5173\u4e8e\u67d0\u9879\u529f\u80fd\u7684\u8ba8\u8bba\uff0c\u4e0e\u522b\u4eba\u6216\u8005\u9879\u76ee\u7ef4\u62a4\u8005\u8fdb\u884c\u76f8\u5173\u7684\u8ba8\u8bba\uff0c\u6211\u4eec\u4f1a\u6839\u636e\u8ba8\u8bba\u7ed3\u679c\u5bf9\u9879\u76ee\u8fdb\u884c\u76f8\u5173\u6539\u8fdb\uff0c\u5f53\u7136\uff0c\u4e5f\u53ef\u80fd\u4e0d\u4f1a\u91c7\u7eb3\u76f8\u5173\u5efa\u8bae\u3002</p>"},{"location":"CONTRIBUTING.html#i-want-to-contribute-","title":"I Want To Contribute - \u60f3\u8d21\u732e","text":"<p>Legal Notice - \u6cd5\u5f8b\u58f0\u660e</p> <p>When contributing to this project, you must agree that you have authored 100% of the content, that you have the necessary rights to the content and that the content you contribute may be provided under the project license. \u5728\u4e3a\u672c\u9879\u76ee\u505a\u51fa\u8d21\u732e\u65f6\uff0c\u60a8\u5fc5\u987b\u540c\u610f\u60a8\u521b\u4f5c\u4e86 100% \u7684\u5185\u5bb9\uff0c\u60a8\u5bf9\u5185\u5bb9\u62e5\u6709\u5fc5\u8981\u7684\u6743\u5229\uff0c\u5e76\u4e14\u60a8\u8d21\u732e\u7684\u5185\u5bb9\u53ef\u4ee5\u5728\u9879\u76ee\u8bb8\u53ef\u4e0b\u63d0\u4f9b\u3002</p>"},{"location":"CONTRIBUTING.html#source-code-","title":"Source Code - \u6e90\u4ee3\u7801","text":"<ul> <li>It must be able to run stably in the latest stable version of the programming environment; \u5fc5\u987b\u4fdd\u8bc1\u80fd\u5728\u6700\u65b0\u7a33\u5b9a\u7248\u672c\u7684\u7f16\u7a0b\u73af\u5883\u4e0b\u7a33\u5b9a\u8fd0\u884c\uff1b</li> <li>The content must be relevant to the project; \u5185\u5bb9\u5fc5\u987b\u4e0e\u9879\u76ee\u76f8\u5173\uff1b</li> <li>The code style meets the requirements (see below); \u4ee3\u7801\u98ce\u683c\u7b26\u5408\u8981\u6c42\uff08\u89c1\u4e0b\u6587\uff09\uff1b</li> <li>Include appropriate comments; \u5305\u542b\u9002\u5f53\u7684\u6ce8\u91ca\uff1b</li> </ul>"},{"location":"CONTRIBUTING.html#document-","title":"Document - \u6587\u6863","text":"<ul> <li>Correct, detailed, and easy to understand; \u6b63\u786e\u3001\u8be6\u7ec6\u4e14\u901a\u4fd7\u6613\u61c2\uff1b</li> <li>Comply with certain specifications; \u7b26\u5408\u4e00\u5b9a\u7684\u89c4\u8303\uff1b</li> </ul>"},{"location":"CONTRIBUTING.html#tutorial-","title":"Tutorial - \u6559\u7a0b","text":"<ul> <li>Accurate; \u51c6\u786e\u65e0\u8bef\uff1b</li> <li>Contains runnable sample code; \u5305\u542b\u53ef\u8fd0\u884c\u7684\u793a\u4f8b\u4ee3\u7801\uff1b</li> <li>The code must contain appropriate comments; \u4ee3\u7801\u5fc5\u987b\u5305\u542b\u9002\u5f53\u7684\u6ce8\u91ca\uff1b</li> <li>If possible, try not to call external resources (such as images, etc.); \u5982\u679c\u53ef\u80fd\uff0c\u4ee3\u7801\u5c3d\u91cf\u4e0d\u8981\u8c03\u7528\u5916\u90e8\u8d44\u6e90\uff08\u5982\u56fe\u7247\u7b49\uff09\uff1b</li> <li>If possible, please add pictures for illustrative purposes; \u5982\u679c\u53ef\u80fd\uff0c\u8bf7\u52a0\u4e0a\u7528\u4e8e\u89e3\u91ca\u8bf4\u660e\u7684\u56fe\u7247\uff1b</li> <li>If possible, please translate into both English and Chinese; \u5982\u679c\u53ef\u80fd\uff0c\u8bf7\u7ffb\u8bd1\u4e3a\u4e2d\u82f1\u53cc\u8bed\uff1b</li> </ul>"},{"location":"CONTRIBUTING.html#other-","title":"Other - \u5176\u4ed6\u5185\u5bb9","text":"<ul> <li>Compliance with certain specifications is sufficient, depending on the circumstances; \u7b26\u5408\u67d0\u4e9b\u89c4\u8303\u5373\u53ef\uff0c\u5177\u4f53\u89c6\u60c5\u51b5\u800c\u5b9a\uff1b</li> </ul>"},{"location":"CONTRIBUTING.html#styleguides-","title":"Styleguides - \u98ce\u683c\u6307\u5357","text":""},{"location":"CONTRIBUTING.html#code-style-","title":"Code style - \u4ee3\u7801\u98ce\u683c","text":"<p>If you want your PR to be merged, we want your code style to be as official as possible, and if you can, we prefer your code to be in line with the project's code style. \u5982\u679c\u4f60\u60f3\u8981\u4f60\u7684 PR \u88ab\u5408\u5e76\uff0c\u6211\u4eec\u5e0c\u671b\u4f60\u7684\u4ee3\u7801\u98ce\u683c\u5c3d\u91cf\u7b26\u5408\u5b98\u65b9\u7684\u98ce\u683c\uff0c\u5982\u679c\u53ef\u4ee5\uff0c\u6211\u4eec\u66f4\u5e0c\u671b\u4f60\u7684\u4ee3\u7801\u53ef\u4ee5\u7b26\u5408\u672c\u9879\u76ee\u7684\u4ee3\u7801\u98ce\u683c\u3002</p>"},{"location":"CONTRIBUTING.html#other-style-","title":"Other style - \u5176\u5b83\u98ce\u683c","text":"<p>For other content, such as Issues, we don't make any stylistic requirements. \u5176\u5b83\u5185\u5bb9\uff0c\u5982 Issues \u7b49\uff0c\u6211\u4eec\u4e0d\u5bf9\u98ce\u683c\u505a\u4efb\u4f55\u8981\u6c42\u3002</p>"},{"location":"CONTRIBUTING.html#join-the-project-team-","title":"Join The Project Team - \u52a0\u5165\u9879\u76ee\u56e2\u961f","text":"<p>If you would like to join the project team, please contact the maintenance staff of the project team at the following contact email: \u5982\u679c\u4f60\u60f3\u52a0\u5165\u9879\u76ee\u56e2\u961f\uff0c\u8bf7\u8054\u7cfb\u9879\u76ee\u56e2\u961f\u7684\u7ef4\u62a4\u4eba\u5458\uff0c\u4e0b\u9762\u662f\u8054\u7cfb\u90ae\u7bb1\uff1a</p> <ul> <li>Main Author: 2951256653@qq.com</li> <li>Maintenance 1: ...</li> <li>Maintenance 2: ...</li> </ul> <p>This contribution guide is based on https://contributing.md/example/. \u8fd9\u4e2a\u8d21\u732e\u6307\u5357\u662f\u57fa\u4e8e https://contributing.md/example/ \u6539\u5199\u7684\u3002</p>"},{"location":"LICENSE.html","title":"\u9879\u76ee\u8bb8\u53ef\u8bc1","text":"<p>MIT License</p> <p>Copyright \u00a9 2024 \u5c0f\u5eb72022</p> <p>Permission is hereby granted, free of charge, to any person obtaining a copy of this software and associated documentation files (the \"Software\"), to deal in the Software without restriction, including without limitation the rights to use, copy, modify, merge, publish, distribute, sublicense, and/or sell copies of the Software, and to permit persons to whom the Software is furnished to do so, subject to the following conditions:</p> <p>The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.</p> <p>THE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR IMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE AUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER LIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM, OUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE SOFTWARE.</p>"},{"location":"Algorithms/Hello%20World.html","title":"Hello World","text":"<ul> <li> HTML for content and structure</li> <li> JavaScript for interactivity</li> <li> CSS for text running out of boxes</li> <li> Internet Explorer ... huh?</li> </ul> <p>\u7279\u522b\u6ce8\u610f</p> <p>\u8fd9\u662f\u4e00\u4e2a\u63d0\u793a\u6846\uff01</p> <p>\u6b64\u9875\u9762\u76ee\u524d\u7528\u4e8e\u6d4b\u8bd5\uff0c\u6682\u65e0\u5185\u5bb9</p> <p>\u70b9\u51fb\u8d77\u98de\uff01</p> C 17C++ 20Python 3.12Java 21 <pre><code>#include &lt;stdio.h&gt;\n\nint main(){\n    printf(\"Hello World!\\n\");  //(1)\n    return 0;\n}\n</code></pre> <ol> <li>\u6b64\u5904\u8f93\u51fa <code>Hello World!</code></li> </ol> <pre><code>import &lt;iostream&gt;;\n\nint main(){\n    std::cout &lt;&lt; \"Hello World!\" &lt;&lt; std::endl;  //(1)\n    return 0;\n}\n</code></pre> <ol> <li>\u6b64\u5904\u8f93\u51fa <code>Hello World!</code></li> </ol> <pre><code>if __name__ == \"__main__\":\n    print(\"Hello World!\")  #(1)\n</code></pre> <ol> <li>\u6b64\u5904\u8f93\u51fa <code>Hello World!</code></li> </ol> <pre><code>public class Java {\n    public static void main(String[] args) {\n        System.out.println(\"Hello World!\");  //(1)\n    }\n}\n</code></pre> <ol> <li>\u6b64\u5904\u8f93\u51fa <code>Hello World!</code></li> </ol> \u8981\u4e0a\u5929 <p>\u8d77\u98de\u55bd\uff01</p>"}]}